script: |
  super -f text -I q1901.spq | sort > q1901.out

inputs:
  - name: q1901.spq
    data: |
      SELECT DISTINCT - col0 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col2 * - 35 + + col2 NOT BETWEEN col1 * - col2 * + col2 AND NULL;
  - name: tab1

outputs:
  - name: q1901.out
    data: |
